const fromApi =[
    {
        type:"text",
        placeholder:"Enter your Name",
        className:"form_btn",
    },
    {
        type:"e-mail",
        placeholder:"Enter e-mail id",
        className:"form_btn",
    },
    {
        type:"number",
        placeholder:"Enter Contact Number",
        className:"form_btn",
    },
    {
        type:"textarea",
        placeholder:"Enter message",
        className:"form_btn",
    },
];

